import React, { useEffect, useState } from "react";
import Axios from "axios";
import { useParams } from "react-router-dom";

function Applicants() {
  const [applicants, setApplicants] = useState([]);
  const [applicantList, setApplicantList] = useState([]);

  const { adId } = useParams();

  const getIndAd = `http://localhost:3001/advert/${adId}`;

  useEffect(() => {
    Axios.get(getIndAd).then((response) => {
      setApplicants(response.data);
      console.log(response.data);
    });
  }, []);

  const getProfile = async () => {
    const objectHeld = applicants[0];
    const response = await Axios.post(
      "http://localhost:3001/application_profiles",
      {
        customerNumber: objectHeld.id_user_customer,
      }
    ).then(
      (response) => {
        console.log("hi");
        console.log(response.data);
        setApplicantList(response.data);
      },
      [applicants]
    );
  };
  return (
    <div>
      <button onClick={getProfile}> getProfile</button>
      <h1>This is your main ad</h1>
    </div>
  );
}

export default Applicants;
